proxy-groups:
  - name: 🚀 节点选择
    type: select
    proxies:
      - ♻️ 自动选择
      - 🚑 故障转移
      - ⚖️ 负载均衡
      - DIRECT
    include-all-proxies: true
  - name: ♻️ 自动选择
    type: url-test
    tolerance: 50
    include-all-proxies: true
    lazy: false
    interval: 300
    timeout: 5000
    url: http://www.gstatic.com/generate_204
  - name: 🚑 故障转移
    type: fallback
    include-all-proxies: true
    lazy: false
    interval: 300
    timeout: 5000
    url: http://www.gstatic.com/generate_204
  - name: ⚖️ 负载均衡
    type: load-balance
    strategy: consistent-hashing
    include-all-proxies: true
    lazy: false
    interval: 300
    timeout: 5000
    url: http://www.gstatic.com/generate_204
  - name: 🎯 全球直连
    type: select
    proxies:
      - DIRECT
      - 🚀 节点选择
      - ♻️ 自动选择
      - 🚑 故障转移
      - ⚖️ 负载均衡
    include-all-proxies: true
  - name: 🛑 全球拦截
    type: select
    proxies:
      - REJECT
      - DIRECT
  - name: 🐟 漏网之鱼
    type: select
    proxies:
      - 🚀 节点选择
      - 🎯 全球直连
      - ♻️ 自动选择
      - 🚑 故障转移
      - ⚖️ 负载均衡
    include-all-proxies: true

